import avatar from "./images/avatar-g766746485_1280.png";
import bascket from "./images/cart.svg";

const Header = () => {
    return ( 
        <header className="header">
        <div className="leftheader">
          <a href="#" className="brandName"><span>JS BAND STORE /</span></a>
          <a href="https://www.facebook.com/irina.skaraeva" target="_blank" className="author"><span> Iryna Skaraieva</span></a>
        </div>

        <nav className="nav">
          <div className="burger">
            <div className="burger__bar"></div>
            <div className="burger__bar"></div>
            <div className="burger__bar"></div>
          </div>

          <a href="#"><img src={bascket} width="40px" height="40px" alt="bascket" className="haederimg1" /></a>
          <button type="submit" className="btn"><span>Sing-Out</span></button>
          <a href="#"><img src={avatar} width="40px" height="40px" alt="circle-icon" className="headerimg2" /></a>
          <a href="#" className="username"><span>Username</span></a>
        </nav>
      </header>
     );
}

export default Header;
